#Nim player used for playing in competition, loads in DNA from string.
#DNA was created on 10/19/23 after 100 epochs with a generation size of 99
#DNA is stored in a string, and is parsed into a list of Gene objects.
#Each Gene object has 3 attributes:
#  prev_board: The previous board state
#  curr_board: The current board state
#  next_board: The next board state
# 
#Given more time I would have tweeked the mutation and crossover more, as well as optimised the training program. It could be 3x faster if I optimised the game playing to not repeat as many games. The DNA also seems to keep getting longer, indicating that it needs more training and has not found a local minimum. Maybe a few days of training would improve the result.
#
# I used "https://www.textfixer.com/tools/remove-line-breaks.php" to remove the new lines from the saved DNA to past it as a string here
#
import numpy as np
import random

class NimPlayer:

  class Gene:
    def __init__(self, prev_board, curr_board, next_board):
      self.prev_board = prev_board
      self.curr_board = curr_board
      self.next_board = next_board
  def load_dna_from_str(self, dna_str):
      #Parses DNA string outputed from genetic_trainer.py
      dna = []
      current_gene = []
      # Split the input data using a space as the delimiter
      gene_str_list = dna_str.split(" ")

      for gene_str in gene_str_list:
          if len(current_gene) < 3:
              try:
                  gene_build = []
                  #cut out the [ and ]
                  gene_str = gene_str[1:-1]
                  for char in gene_str:
                    #ignore ","
                    if char.isnumeric():
                        gene_build.append(int(char))
                    #None
                    elif char == 'N':
                        gene_build.append(None)
                  current_gene.append(gene_build)
                        
              except ValueError:
                  print(f"Invalid data: {gene_str}")
          else:
              dna.append(self.Gene(current_gene[0], current_gene[1], current_gene[2]))
              current_gene = []

      return dna

